import './ContactMe.css'
const ContactMe = () => {
    return ( 
        <div className="contact_div">
            <div className="form_div">
                <div className="text_area_div">
                    <textarea></textarea>
                </div>
                <div className="button_div">
                    button
                </div>
            </div>
        </div>
    );
}
 
export default ContactMe;
